using System;
using System.Web.Script.Serialization;
using System.Web.Services;

namespace HTML5WebWorkerExample
{
    public partial class main : System.Web.UI.Page
    {
        protected void Page_Load(object sender, EventArgs e)
        {
            // Stream down the first page of data
            JavaScriptSerializer jsonSerializer = new JavaScriptSerializer();
            ClientScript.RegisterStartupScript(this.GetType(), "InitData", ("var g_arrInitData = " + jsonSerializer.Serialize(GetNextPage("0"))), true);
        }


        [WebMethod]
        public static object GetNextPage(string sPageIndex)
        {
            Employee[] arrEmployees = null;

            // We're hard coding this just to keep things simple for the Web Worker example. In production, you would pull images from the file system, from a database, etc.
            if (sPageIndex == "0")
            {
                arrEmployees = new Employee[5] {
                    new Employee{EmpId = "100", EmpName = "Jane Doe", EmpImg = ""},
                    new Employee{EmpId = "101", EmpName = "Samantha Baskin", EmpImg = ""},
                    new Employee{EmpId = "102", EmpName = "Kim Daigle", EmpImg = ""},
                    new Employee{EmpId = "103", EmpName = "Elizabeth Hamm", EmpImg = ""},
                    new Employee{EmpId = "104", EmpName = "Kathy Brown", EmpImg = ""},
                };
            }
            else if (sPageIndex == "1")
            {
                arrEmployees = new Employee[5] {
                    new Employee{EmpId = "105", EmpName = "John Smith", EmpImg = ""},
                    new Employee{EmpId = "106", EmpName = "Sam Kline", EmpImg = ""},
                    new Employee{EmpId = "107", EmpName = "Richard King", EmpImg = ""},
                    new Employee{EmpId = "108", EmpName = "Adam Powers", EmpImg = ""},
                    new Employee{EmpId = "109", EmpName = "Scott Richie", EmpImg = ""},
                };
            }
            else if (sPageIndex == "2")
            {
                arrEmployees = new Employee[5] {
                    new Employee{EmpId = "110", EmpName = "Kevin Adams", EmpImg = ""},
                    new Employee{EmpId = "111", EmpName = "Josh Atkinson", EmpImg = ""},
                    new Employee{EmpId = "112", EmpName = "Brian Zack", EmpImg = ""},
                    new Employee{EmpId = "113", EmpName = "Tim Oakes", EmpImg = ""},
                    new Employee{EmpId = "114", EmpName = "Peter Yager", EmpImg = ""},
                };
            }
            else if (sPageIndex == "3")
            {
                arrEmployees = new Employee[3] {
                    new Employee{EmpId = "115", EmpName = "Rene Leblanc", EmpImg = ""},
                    new Employee{EmpId = "116", EmpName = "Crystal Dalton", EmpImg = ""},
                    new Employee{EmpId = "117", EmpName = "Sarah Richards", EmpImg = ""},
                };
            }

            return arrEmployees;
        }
    }

    // Class that gets serialized to JSON for the JavaScript
    public class Employee
    {
        public string EmpId { get; set; }
        public string EmpName { get; set; }
        public string EmpImg { get; set; }
    }
}